import {React,Component} from 'react'
import SearchBar from './searchBar'

class HomeBase extends Component{

    constructor(props){
        super(props);
        this.state = {
           searchTerm:"",
        }
    }

    render(){
        return(
            <SearchBar/>
        )
    }
}

export default HomeBase;
